import React, { useState } from 'react';
import AuthLayout from '../components/AuthLayout.tsx';
import SocialButtons from '../components/SocialButtons.tsx';

const RegisterPage: React.FC = () => {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [agreed, setAgreed] = useState(false);
  
  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Register attempt:', { username, email, password, agreed });
    // Здесь будет вызов Go-бэкенда
  };

  const RegisterIllustration = () => (
    // Заглушка, имитирующая иллюстрацию с девушкой
    <div style={{ textAlign: 'center' }}>
      <img src="https://i.imgur.com/W2d0fJ3.png" alt="Register Illustration" style={{ maxWidth: '80%', height: 'auto' }} />
    </div>
  );

  return (
    <AuthLayout illustration={<RegisterIllustration />}>
      <h1 className="auth-title">Adventure starts here 🚀</h1>
      <p className="auth-subtitle">Make your app management easy and fun!</p>

      <form onSubmit={handleSubmit}>
        {/* Поле Username */}
        <div className="form-field-group">
          <label htmlFor="username" className="form-label">Username</label>
          <input 
            type="text" 
            id="username" 
            className="form-input" 
            placeholder="Enter your username" 
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>

        {/* Поле Email */}
        <div className="form-field-group">
          <label htmlFor="email" className="form-label">Email</label>
          <input 
            type="email" 
            id="email" 
            className="form-input" 
            placeholder="Enter your email" 
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        {/* Поле Password */}
        <div className="form-field-group">
          <label htmlFor="password" className="form-label">Password</label>
          <input 
            type="password" 
            id="password" 
            className="form-input" 
            placeholder="············"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>

        {/* Checkbox "I agree" */}
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: '24px' }}>
          <label style={{ fontSize: '0.875rem', color: '#3f4254', display: 'flex', alignItems: 'center' }}>
            <input type="checkbox" style={{ marginRight: '8px' }} checked={agreed} onChange={(e) => setAgreed(e.target.checked)} required />
            I agree to <a href="/terms" style={{ color: '#696cff', textDecoration: 'none', marginLeft: '4px', fontWeight: 500 }}>privacy policy & terms</a>
          </label>
        </div>

        <button type="submit" className="primary-button" disabled={!agreed}>
          Sign Up
        </button>
      </form>

      <p style={{ textAlign: 'center', fontSize: '0.9rem', marginTop: '24px' }}>
        Already have an account? <a href="/login" style={{ color: '#696cff', textDecoration: 'none', fontWeight: 500 }}>Sign in instead</a>
      </p>

      <div className="separator">or</div>
      <SocialButtons />
    </AuthLayout>
  );
};

export default RegisterPage;
